import { Link, Outlet } from 'react-router-dom';

export default function BlogLayout() {
	return (
		<>
			<nav>
				<ul>
					<li><Link to="blog/:id" /></li>
		   	</ul>
			</nav>
			<Outlet context={{ hello: 'Hello'}} />
		</>
	)
}
